import React from 'react';

const CricketBallIcon = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="48"
      height="48"
      viewBox="0 0 24 24"
      fill="none"
      className="cricket-ball-icon"
    >
      {/* Outer circle representing the cricket ball */}
      <circle cx="12" cy="12" r="10" fill="#d32f2f" stroke="#880e4f" strokeWidth="2" />

      {/* Main seam across the middle */}
      <path
        d="M4 12c4 4 8 4 12 0"
        stroke="white"
        strokeWidth="1.5"
        strokeDasharray="2 1"
      />

      {/* Two additional seams to represent the stitched threads */}
      <path
        d="M4 9.5c4 4 8 4 12 0M4 14.5c4 4 8 4 12 0"
        stroke="white"
        strokeWidth="1.5"
        strokeDasharray="2 1"
      />
    </svg>
  );
};

export default CricketBallIcon;
